/** @format */

import React from 'react';
import { Router, Switch, Route } from 'react-router-dom';

import Directory from './pages/directory/directory.page';

import './App.css';

function App() {
	return (
		<>
			<Router>
				<switch>
					<Route path='/' exact component={Directory} />
				</switch>
			</Router>
		</>
	);
}

export default App;
